import React from "react";
import {Router, Route} from 'react-router-dom'
import Login from './auth/Login'
    
function Body(){
    return(
        <Section>
            <Switch>
                <Route path ="/login" component={Login} exact></Route>
            </Switch>
        </Section>
    )
}

export default Body
